import "./Desktop1.css";

const Desktop1 = () => {
  return (

    <body className="body">

    <div className="desktop-1">
          <h2>Enter your Details</h2>
          <img className="svg-user" alt="" src="../user.svg" />
          <div class="box">
                {/* <img className="svg-user" alt="user-pic" src="../line-41.svg"/> */}
                <input type="email" name="email" id="email" placeholder="Enter your Email" ></input>
            </div>

    </div>
    </body>
  );
};

export default Desktop1;
